import React, { Component } from 'react'

class TrackListItem extends Component {

    constructor(props) {
        super(props);
    }

  render() {
    const images = this.props.track.image;
    const mediumImageArray = images[3];
    const trackImage = mediumImageArray[Object.keys(mediumImageArray)[0]]; 
    return (
      <li className="top-track grid-cell">
        <span>  Name: {this.props.track.name}   </span> 
        <span>  Artist: {this.props.track.artist.name}</span>

      </li>
    )
  }
}

export default TrackListItem;
